import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";
import {
  HeaderWrapper,
  Logo,
  HeaderItemBar,
  Headernav,
  HeaderLogin,
  HeaderBtn,
  Stick,
  Wrapper,
  ProfileBtn,
  Image,
} from "./mainStyle"
import Slider from "react-slick";
import Img1 from "../assets/banner/1.jpg"
import Img2 from "../assets/banner/2.jpg"
import Img3 from "../assets/banner/3.jpg"
import Img4 from "../assets/banner/4.jpg"
const Main = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 700,
    slidesToShow: 1,
    slidesToScroll: 1,
    ArrowBtn: true,
    // nextArrow: <SampleNextArrow />,
    // prevArrow: <SampleNextArrow />,
    autoplaySpeed: 6000,
    autoplay: true,
  };

  const imgslide = [{
    value:0,
    imgurl: Img1
  },{
    value:1,
    imgurl: Img2
  },{
    value:2,
    imgurl: Img3
  },{
    value:3,
    imgurl: Img4
  }]

  return (
    <>
      <HeaderWrapper>
        <Wrapper>
        <StyledSlider {...settings}>
        {imgslide.map((item) => {
            <Image src={item.imgurl} /> 
        })}
      </StyledSlider>
        </Wrapper>
      </HeaderWrapper>
    </>
  );
};

export default Main;
const StyledSlider = styled(Slider)`
  .slick-slide div {
    outline: none;
  }
  .arrow
`;
